import React from "react";
import styled from "styled-components";

const FooterArea = styled.footer`
    height: 62px;
    width: 100%;
    display: flex;
    align-items: center;
    justify-content: center;
    position: absolute;
    bottom: 0;
    position: fixed;
    bottom: 0;
    background-color: white;
    z-index: 3;
`;

const Footer = () => {
    return(
        <FooterArea>
            <img src="../public/descarga.png"/>
        </FooterArea>
    );
}

export default Footer;
